import React from 'react'
import './ImageShow.css'

class ImageShow extends React.Component{
    render(){
        return (
           <div className="container" style={{ backgroundImage: "url(/portfolio-covers/print1.jpg)" }}>
               <p className="text">Bernardo Branco</p>
               <h1>Digital Art</h1>
           </div>
        )
    }
}

export default ImageShow
